import { BrowserRouter, Route } from "react-router-dom";
import { Link } from "react-router-dom";

const ShopEnlaces = () => {
  return (
    <BrowserRouter>
      <div className="menu_shop">
        <ul className="shop_enlaces">
          <li>
            <Link to="/productos_femme/">FEMME</Link>
          </li>
          <li>
            <Link to="/productos_homme/">HOMME</Link>
          </li>
          <li>
            <Link to="/productos_wetsuit/">WETSUITS</Link>
          </li>
          <li>
            <Link to="/productos_shorty/">SHORTYS</Link>
          </li>
          <li>
            <Link to="/productos_top/">TOPS</Link>
          </li>
        </ul>
      </div>
    </BrowserRouter>
  );
};

export default ShopEnlaces;
